import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
function App() {
  return (
    <div>
    <div class="App-header">
    <div class="App-logo">
      <img src="Inquest.png"/>
    </div>
    </div>
    <nav class="navbar navbar-dark bg-dark">
    <img src="Inquest.png"/>
  </nav></div>
  );
}

export default App;
